import styles from './Header.module.css';

const Header = () => {
  return (
    <nav className={styles.header}>
      <ul>
        <li>01. About</li>
        <li>02. Experience</li>
        <li>03. Works</li>
        <li>04. Contact</li>
      </ul>
      <img src="../../assets/logo.svg" alt="logo" className={styles.logo} />
      <button type="button" className={styles.button}>
        Resume
      </button>
    </nav>
  );
};

export default Header;
